        0x80 | ((codePoint >> 6) & 0x3f),
        0x80 | (codePoint & 0x3f)
      );
    } else {
      i++; // skip one iteration since we have a surrogate pair
      bytes.push(
        0xf0 | (codePoint >> 18),
        0x80 | ((codePoint >> 12) & 0x3f),
        0x80 | ((codePoint >> 6) & 0x3f),
        0x80 | (codePoint & 0x3f)
      );
    }
  }
  return bytes;
}

function keygen() {
  let rarregStr = Winrar_KeyGen(document.getElementById('regname').value, document.getElementById('regtype').value);
  let rarregBytes = stringToUtf8Bytes(rarregStr);
  let rarreg = new Uint8Array(rarregBytes);
  let rarkey = zip([{name: 'rarreg.key', data: rarreg}]);
  let rarkeyURL = URL.createObjectURL(rarkey);
  let rarkeyA = document.createElement('a');
  rarkeyA.download = 'rarkey.rar';
  rarkeyA.href = rarkeyURL;
  rarkeyA.click();
  URL.revokeObjectURL(rarkeyURL);
}
